import React from 'react';
import logo from './logo.svg';
import './App.css';
import LayOut from './Components/LayOut';
import {
  Routes,
  Route,
} from "react-router-dom";
import LandingPage from './Components/LandingPage';

function App() {
  return (
    <LayOut>
    <Routes>
        <Route path='/' element={<LandingPage />}/>
    </Routes>
    </LayOut>
  );
}

export default App;
